@Vinceva25 Bonsoir @Vinceva25, merci de nous contacter sur Twitter.
Afin de vous aider à réserver votre billet, merci de nous préciser par DM votre parcours, dates de voyage, vols choisis, ainsi que le nombre de voyageurs.
Dans l’attente de votre retour, nous restons disponibles.

@PtitPandaBNE Bonsoir @PtitPandaBNE, bienvenue sur notre page Twitter. 
Si vous avez oublié votre effet personnel, nous vous invitons à faire votre déclaration de perte via ce lien : [LIEN] 
Nous vous souhaitons une bonne soirée.

@MorganeJDN @MorganeJDN  Bonsoir, merci de nous avoir contactés sur Twitter. 
Nous vous invitons à nous en dire plus en DM.
