@mokawi Nous comprenons votre ressenti. Pouvez-vous nous indiquer en Direct Message la référence 
de votre dossier de réservation ?
Nous restons disponibles.

@TribillacV Bonjour, nous entendons votre mécontentement. Avez-vous déjà effectué une réclamation auprès de notre service Client ?
Dans le cas contraire, nous vous invitons à le faire dès maintenant via ce lien [LIEN]
Nous vous souhaitons une bonne fin de journée.

@AKM25707767 Bonjour @AKM25707767,
Merci pour l'alerte ! Nous remontons au plus vite votre message aux équipes concernées. Vous avez également la possibilité de le signaler sur le site d'Air France en suivant ce lien : [LIEN]
Bonne journée, Sandrine✈

