@cyberguerre Bonjour Nicolas, bienvenue sur Twitter.
Il arrive que certaines des compagnies partenaires n'autorisent pas l'enregistrement via notre site. Dans ce cas, nous vous invitons à essayer via le site Internet de la compagnie en question ou directement à l'aéroport.
Belle journée.
